import Homepage from './home/Homepage'
import "./styles.css";

function App() {
  return (
    <div>
      <head>
        <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Tangerine"/>
      </head>
      <body>
        <Homepage/>
      </body>
    </div>
  );
}

export default App;
